import React from 'react';
import './Card.css'; 

const Card = ({ title, image }) => {
  return (
    <div className="card">
      <div className="card-content">
        <h2 className="card-title">{title}</h2>
        <img src={image} alt={title} className="card-image" />
      </div>
    </div>
  );
};

export default Card;
